import { Route, Switch } from "react-router-dom";
import Headerbar from "../Headerthingys/Headerbar";
import Postad from "../../pages/Sellingpage/Postad";
import Horizontalbar from "../Horizontalbar/Horizontalbar";
import Mainbody from "../Mainbody/Mainbody";
import SignupPage from "../Loginthingys/SignupPage";

const Navigation = () => {
	return (
		<>
			<Switch>
				<Route path="/" exact>
					<header>
						<Headerbar />
					</header>
					<div>
						<Horizontalbar />
					</div>
					<Mainbody />
				</Route>
				<Route path="/post-ad" exact>
					<Postad />
				</Route>
				<Route path="/login" exact>
					
				</Route>
				<Route path="/signup" exact>
					<SignupPage />
				</Route>
			</Switch>
		</>
	);
};

export default Navigation;
